func TestEntity_HandleEntity_RawData(t *testing.T) {
	eventData := `{
    "Patches": {
      "patches": [
        {
          "path": "properties.rawData",
          "operator": "replace",
          "value": ""
        }
      ]
    }
  }`
	event := `{
  "id": "403e02d8-3653-4145-bcda-4e8528f28a91",
  "timestamp": 1676339189847765975,
  "metadata": {
    "x-msg-en-id": "iotd-e130acba-1fd5-4e4f-8b51-5824d930e19f",
    "x-msg-en-type": "iothub",
    "x-msg-owner": "device",
    "x-msg-source": "AJJfReg1",
    "x-msg-topic": "core-pub",
    "x-msg-type": "core.event.Entity"
  }
}`
	entityStr := ""

	v := &v1.ProtoEvent{}
	err := json.Unmarshal([]byte(event), v)
	t.Log(err)
	vd := &v1.ProtoEvent_Patches{}
	err = json.Unmarshal([]byte(eventData), vd)
	t.Log(err)
	v.Data = vd

	bytes, err := base64.StdEncoding.DecodeString(entityStr)
	t.Log(err)
	e, err := NewEntity("iotd-e130acba-1fd5-4e4f-8b51-5824d930e19f", bytes)
	t.Log(err)

	ret := handleEntity(t, v, e)
	t.Log(ret)
}

